func TestMsgDecoder(t *testing.T) {
	msg := []string{
		"B5EE9C7201010101005200009F5FCC3D14000000000000000080066060C71D54611B6CA591D23CC2FD34C5EE78CE9A6118B533BFEA86A149931A3000CC0C18E3AA8C236D94B23A47985FA698BDCF19D34C2316A677FD50D42932634408", // nft transfer
		"b5ee9c7201010101000e00001800000000776f6f3071387762", // text
		"B5EE9C7201010101005E0000B80F8A7EA500000000000000007038D7EA4C680008015CD3F8AE39269A71BFAD944735473394AB8D175E5B16B653B3602B764218D3BD0035D9D9CE4B9C0D7612E9BE0E582E4E67D890C3AF35E142878AC10F4B609B08DC020200000000", // ft transfer
		"B5EE9C7201010101000E000018D53276DB0000000000000000",                                                                     // excess
		"B5EE9C7201010101003000005B05138D9100000000000000008004479BDAFD7A4200C676136DC05E6D4F03B5ED83AEE7C1C59532CF2630C5B180A8", // nft ownership assigned
	}
	for _, m := range msg {
		h, _ := hex.DecodeString(m)
		c, _ := boc.DeserializeBoc(h)

		s, _, err := MessageDecoder(c[0])
		if err != nil {
			t.Error(err)
		}
		fmt.Printf("%s\n", s)
	}
}

func TestSimpleGetMethod(t *testing.T) {
	type contract struct {
		Code      string
		Data      string
		Account   string
		GetMethod int
	}

	contracts := []contract{
		// NFT item
		{
			Code:      "",
			Data:      "",
			Account:   "0:01865643806A9FA5C1847687EA747E47437DFC5E5F442354F98D8CE796A15885",
			GetMethod: 102351,
		},
		// NFT collection
		{
			Code:      "",
			Data:      "",
			Account:   "0:4AD02E7966E67CB29C78089904DFAECB2442A6937592F11AE4BE5FB15E998484",
			GetMethod: 102491,
		},
		// Jetton master
		{
			Code:      "",
			Data:      "",
			Account:   "0:29DD8C6A684D5687251E1DAD3EECF1A38F15D974FCB8EDDF3009D44F387C01F8",
			GetMethod: 106029,
		},
		// Jetton wallet
		{
			Code:      "",
			Data:      "",
			Account:   "0:4F8D1285579F1357AEA0100D3EBB673100F8D4D80A0D48CF981617A87C308F20",
			GetMethod: 97026,
		},
		// NFT sale GetGems
		{
			Code:      "",
			Data:      "",
			Account:   "0:A2379AC876F1212733CE44BE7E276C1C723D39005EC3A35E923656AC30C2234B",
			GetMethod: 72748,
		},
		// NFT sale
		{
			Code:      "",
			Data:      "",
			Account:   "0:F03EE3E47E7DCFAAF962C0C5A8F825140956CDA9E517C636D8C0E0B2DFC8A5A6",
			GetMethod: 72748,
		},
		// NFT royalty
		{
			Code:      "",
			Data:      "",
			Account:   "0:1FC363BF72D52ACFF695E86D46E20D8D432D36BF9FE6E229971ED51C283D2D29",
			GetMethod: 85719,
		},
	}

	config, _ := boc.DeserializeBocBase64("")

	for _, c := range contracts {
		codeBytes, _ := hex.DecodeString(c.Code)
		dataBytes, _ := hex.DecodeString(c.Data)
		codeCell, _ := boc.DeserializeBoc(codeBytes)
		dataCell, _ := boc.DeserializeBoc(dataBytes)
		account, _ := tongo.AccountIDFromRaw(c.Account)
		emulator, err := tvm.NewEmulator(codeCell[0], dataCell[0], config[0], 1_000_000_000, 0)
		if err != nil {
			t.Fatal(err)
		}
		err = emulator.SetVerbosityLevel(1)
		if err != nil {
			t.Fatal(err)
		}
		_, ok := KnownSimpleGetMethods[c.GetMethod]
		if !ok {
			t.Fatal("unknown method")
		}
		for _, m := range KnownSimpleGetMethods[c.GetMethod] {
			s, r, err := m(context.Background(), emulator, account)
			if err != nil {
				t.Fatal(err)
			}
			fmt.Printf("Result type: %s\n", s)
			_ = r
		}
	}
}
